// src/components/Wizyta/WizytaDetail.js
import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import api from '../../api';

const WizytaDetail = () => {
  const { id } = useParams();
  const [wizyta, setWizyta] = useState(null);

  useEffect(() => {
    api.get(`/wizyty/${id}/`)
      .then(response => setWizyta(response.data))
      .catch(error => console.error('Błąd pobierania szczegółów wizyty:', error));
  }, [id]);

  if (!wizyta) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h2>Szczegóły Wizyty</h2>
      <p>Data i godzina: {wizyta.data_i_godzina}</p>
      <p>Lekarz: {wizyta.lekarz.imie} {wizyta.lekarz.nazwisko}</p>
      <p>Pacjent: {wizyta.pacjent.imie} {wizyta.pacjent.nazwisko}</p>
      <p>Status: {wizyta.status}</p>
      {/* Dodaj inne dane wizyty */}
    </div>
  );
};

export default WizytaDetail;
